Remark: Basketball Rank
select leag.CALIAS, leag.CORG, rank.IRANK, team.CTEAM, team.CTEAM_ID, rank.IWIN, rank.ILOSS, rank.ICONSECTIVE, rank.ICONSECTIVE_TYPE 
from LEAGUE_INFO leag
LEFT OUTER JOIN TEAM_INFO team ON team.CTEAM_ID in (select CTEAM_ID from IDMAP_INFO where CLEAG_ID='01') 
LEFT OUTER JOIN RANK_LEAGUE_INFO rank ON rank.CLEAG_ID=leag.CLEAG_ID and rank.CLEAG_ID='01' and rank.CTEAM_ID=team.CTEAM_ID 
ORDER BY rank.IRANK

Remark: Soccer Rank
SELECT leag.ALIAS, rank.RANK, team.TEAMNAME, rank.GAMES, rank.SCORE 
FROM LEAGINFO leag 
LEFT OUTER JOIN TEAMINFO team ON team.TEAM_ID in (select TEAM_ID from ID_INFO where LEAG_ID='001') 
LEFT OUTER JOIN LEAGRANKINFO rank ON rank.LEAG_ID=leag.LEAG_ID and rank.LEAG_ID='001' and rank.TEAM=team.TEAMNAME 
ORDER BY rank.RANK

Remark: Soccer Rank
SELECT rank.RANK, rank.TEAM, rank.GAMES, rank.SCORE from LEAGRANKINFO rank where rank.LEAG_ID='001' order by rank.RANK

Remark: Soccer BigSmallOdds
SELECT bs.IMATCH_CNT, bs.IORDER_NO, game.MATCH_CNT, game.LEAGUE, game.HOST, game.GUEST, game.MATCHDATE, game.MATCHTIME, bs.CSCORE, bs.CBIGODDS, bs.CSMALLODDS, bs.CSTATUS 
FROM GAMEINFO game 
INNER JOIN LEAGINFO leag ON game.LEAGUE = leag.alias and leag.leag_id in (select cleag_id from userprofile_info where iuser_id=1) 
LEFT OUTER JOIN BIGSMALLODDS_INFO bs ON bs.IMATCH_CNT = game.MATCH_CNT 
ORDER BY bs.IORDER_NO, leag.leag_order, game.MATCHDATE, game.MATCHTIME

Remark: Soccer Get Team to Modify
select id.LEAG_ID, team.TEAMNAME, team.COUNTRY, team.CITY, team.VENUE, 
team.CONTINENT, team.CENGNAME, team.CMACAUNAME, team.CHKJCNAME 
from TEAMINFO team 
LEFT OUTER JOIN ID_INFO id ON id.TEAM_ID='044' 
where team.TEAM_ID='044' order by id.LEAG_ID

Remark: User Profile
select pro.CLEAG_ID, leag.LEAGNAME from USERPROFILE_INFO pro, LEAGINFO leag where pro.IUSER_ID=1 and pro.CLEAG_ID=leag.LEAG_ID and pro.CLEAG_ID not like 'x%' and leag.LEAGNAME like '英%'

Remarks: Soccer Schedule
select distinct leag.LEAG_ID, leag.ALIAS 
from LEAGINFO leag, SOCCERSCHEDULE sch 
where leag.leag_id in (select cleag_id from userprofile_info where iuser_id=1) 
AND leag.ALIAS = sch.CLEAGUEALIAS 
order by leag.LEAG_ORDER, leag.LEAG_ID

Remark: Other region Match Menu
select oth.alias, oth.host, oth.guest, min(oth.MATCH_CNT)
from OTHERODDSINFO oth
JOIN LEAGINFO leag ON leag.LEAG_ID in (select cleag_id from userprofile_info where iuser_id=1) and oth.ALIAS=leag.alias
GROUP BY oth.alias, oth.host, oth.guest
order by leag.LEAG_ORDER, oth.MATCH_CNT


CREATE INDEX OTHODDS_HOSTX ON OTHERODDSINFO(HOST);
CREATE INDEX OTHODDS_GUESTX ON OTHERODDSINFO(GUEST);









